                                <div key={item.productId}>
                                <span>{item.productName}</span>
                                <span>{item.quantity}</span>
                                <button onClick={() => updateProductQuantity(item.productId, item.quantity + 1)}>Increase</button>
                                <button onClick={() => updateProductQuantity(item.productId, item.quantity - 1)}>Decrease</button>
                                <button onClick={() => removeFromCart(item.productId)}>Remove</button>
                                </div>
                            ))}
                        {/* </div> */}
                </tbody>
            </table>
            <div className="clearCartGroup">
                {/* <button onClick={clearCart} className="clearCart">Clear Cart</button> */}
                <span>Grand Total: ${roundedQuantity(grandTotal)}</span>
            </div>
            <div className="buttonsGroup">
                <button className="continueBtn">Continue Shopping</button>
                <button className="checkoutBtn">Proceed To Checkout</button>
            </div>
        </div> 
    );
}

export default CartPage;
